[Chef Nyas]
Even though I have no time to spare, I usually serve a bowl of soup gladly, but now;
One of the ingredients is infested with worms, 'cause of one person's carelessness!

I3aaAQ.pt:
[Chef Nyas]
Embora eu não tenha tempo de sobra, normalmente sirvo uma tigela de sopa com prazer, mas agora;
Um dos ingredientes está infestado de vermes, por causa da falta de cuidado de uma pessoa!
